import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App(){
    return(
        <div>
            <Card 
            name = {contacts[0].name}
            img = {contacts[0].img}
            tel = {contacts[0].tel}
            email = {contacts[0].email}
            />
            <Card 
            name = {contacts[1].name}
            img = {contacts[1].img}
            tel = {contacts[1].tel}
            email = {contacts[1].email}
            />
            <Card 
            name = {contacts[0].name}
            img = {contacts[0].img}
            tel = {contacts[0].tel}
            email = {contacts[0].email}
            />
        </div>
    )
}
export default App
